Output the largest prime number before 10,000.

```
def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True

largest_prime = 0
for i in range(1, 10000):
    if is_prime(i):
        largest_prime = i
print(largest_prime)
```

